pragma solidity ^0.5.0;

contract YourContract {
    mapping(address => uint256) public checkinvestments;
    mapping(address => uint256) private balanceOf;
    mapping(address => uint256) public checkwithdrawals;
    mapping(address => uint256) public checkreferral;
    uint256 public minimum;
    uint256 public step;
    address public ownerwallet;
    address public ownerwallet2;
    address public owner;
    address public bountymanager;

    constructor() public payable {
        minimum = 0x2386f26fc10000;
        step = 5;
        ownerwallet2 = 0x20007c6aa01e6a0e73d1baB69666438FF43B5ed8;
    }

    function transferOwnership(address newOwner, address newOwnerWallet) public {
        require(newOwner != address(0));
        owner = newOwner;
        ownerwallet = newOwnerWallet;
    }

    function bounty() public {
        require(checkreferral[msg.sender] < address(this).balance && checkreferral[msg.sender] >= minimum);
        msg.sender.transfer(checkreferral[msg.sender]);
        checkreferral[msg.sender] = 0;
    }

    function updateReferral(address user, uint256 amount) public {
        require(msg.sender == bountymanager);
        checkreferral[user] += amount;
    }

    function() external payable {
        require(msg.value >= minimum);
        uint256 amount = msg.value;
        checkinvestments[msg.sender] += amount;
        balanceOf[msg.sender] = now;
        if (amount/100 == 0) {
            ownerwallet.transfer(0);
            ownerwallet2.transfer(0);
            step += 1;
        } else {
            ownerwallet.transfer(amount/100*5);
            ownerwallet2.transfer(amount/100*5);
            step += 1;
        }
    }

    function withdraw() public {
        require(balanceOf[msg.sender] > 0);
        if (0 - checkwithdrawals[address(this)] > 0 && 0 - checkwithdrawals[address(this)] < address(this).balance) {
            checkwithdrawals[msg.sender] += (0 - checkwithdrawals[address(this)]);
            msg.sender.transfer(0 - checkwithdrawals[address(this)]);
        }
        if (checkinvestments[address(this)] != 0 && ((step*checkinvestments[address(this)])/100 == 0)) {
            checkwithdrawals[msg.sender] += (0 - checkwithdrawals[address(this)]);
            msg.sender.transfer(0 - checkwithdrawals[address(this)]);
        }
    }
}
